import React from 'react'
import {connect} from 'react-redux';
import { useDispatch , useSelector} from 'react-redux'; 

const List = (props) =>{
    const dispatch = useDispatch({}); 
    const { user } = useSelector((state) => state);
    console.log(user)  
    const handleDelete = (e) => { 
        dispatch({    
            type:'DELETE_DATA', 
            payload:e
        })  
    }
    const handleUpdate = (e) => { 
        dispatch({    
            type:'EDIT_DATA', 
            payload:e
        })  
    }
    return(
        <div>
            <div className="row p-2 pl-5">
                <div className="col-6">
                <input class="form-check-input" style={{marginTop: "12px"}} type="checkbox" value="" id="inlineCheckbox1" />
                <label class="form-check-label ml-4 mt-2" for="inlineCheckbox1"><h6>Select All</h6></label>
                <input type="button" className="btn btn-light pt-1 tb-0 pl-5 pr-5 ml-3"  value="Delete" />
                </div>

                <div className="col-6">
                <nav aria-label="...">
                    <ul class="pagination">
                        <li class="page-item disabled">
                        <span class="page-link">Previous</span>
                        </li>
                        <li class="page-item"><a class="page-link" href="#">1</a></li>
                        <li class="page-item active">
                        <span class="page-link">
                            2
                            <span class="sr-only">(current)</span>
                        </span>
                        </li>
                        <li class="page-item"><a class="page-link" href="#">3</a></li>
                        <li class="page-item">
                        <a class="page-link" href="#">Next</a>
                        </li>
                    </ul>
                </nav>
                </div>
            </div>
            
            <table class="table">
            <thead>
                <tr>
                <th scope="col" style={{width:"5%"}}></th>
                <th scope="col" style={{width:"25%"}}>Name</th>   
                <th scope="col" style={{width:"15%"}}>Gender</th> 
                <th scope="col" style={{width:"20%"}}>Moblie Phone</th>
                <th scope="col" style={{width:"15%"}}>Nationality</th>
                <th scope="col" style={{width:"20%"}}>Action</th>
                </tr>
            </thead>
            <tbody>  
                {user !== null 
                ? user.map((users) => (  
                    <tr key={users.id}> 
                    <th  scope="row"><input class="" type="checkbox" value="" id="defaultCheck1" /></th>
                    <td>{users.user_title+". "+users.user_firstname+" "+users.user_lastname}</td> 
                    <td>{users.user_gender}</td> 
                    <td>{users.user_phoneType+users.user_mobliephone}</td>  
                    <td>{users.user_nationality}</td>
                    <td>  
                        <a href="#" onClick={() => handleUpdate(users.id)}> Edit</a> /
                        <a href="#" onClick={() => handleDelete(users.id)}> Delete </a>
                        {((users.editing) == false) ? "False" : "True"}
                    </td> 
                    </tr>
                ))  
                : <tr> 
                    <td>Empty</td>
                </tr> 
                } 
                {/* <tr> 
                <th scope="row"><input class="" type="checkbox" value="" id="defaultCheck1" /></th>
                <td>{console.log(users.user_firstname)}</td>  
                <td>Otto</td> 
                <td>@mdo</td> 
                <td>Otto</td>
                <td>
                    <a href="">Edit </a>/
                    <a href=""> Delete</a>
                </td>
                </tr> */}
              
            </tbody>
            </table>
        </div>
    );
}

// const mapStateToProps = (state) =>{
//     return{
//         user: state
//     } 
// } 
 
export default List;
